window.bookSummaryJSON = "<p><b>[Last season in Multiverse Z!] A Shade Dragon Rogue slayed an epic boss monster two realms of power stronger than him and married the War Siren Princess!</b></p> <p>As the Greatest Beginner, Joey Eclipse had the best First Ascension anyone at Level 100 could hope for. This is after an apocalypse where the multiverse integrates whole universes and initiates countless humans to its game-like realms of limitless magic.</p> <p>Joey's marriage with Maylolee Eclipse is system-blessed with beneficial cheat powers. The duo can level up together way faster than anyone else.</p> <p>He has two legendary weapons at his disposal. Two rare dungeons for loot farming. And he evolved into something never before seen in Multiverse Z, which granted him supercharged powers over shadow, necromancy, dragon magic, and chaos cultivation while backed by his wife's overpowered abilities in warfighting, charm, titanic strength, and system divinity.</p> <p>It seemed like nothing could stop Joey. Until he and his wife end up in a hellish death trap universe with monsters in the Level 200s, way higher than him and his wife. This place is supposed to be the end of them.</p> <p>Instead, Joey uses his new chaotic and divine powers to survive, grind up more levels, more stats, more achievements, and craft superior magic weapons for slaying monsters nobody else can. He goes on the warpath to eliminate the hellish hordes and hunt down the rulers in charge.</p> <p>Follow Joey in the sixth installment of a fun, fast-paced, action-adventure book that's perfect for fans of He Who Fights With Monsters, Cradle, and The Primal Hunter. Enjoy an apocalypse isekai with a strong progression LitRPG, cultivation system, and happy marriage between two battle freaks.</p> <p>[Welcome back to Multiverse Z!]</p> <p>[Now let's continue the show!]</p>"; 
